import React, { useEffect, useState } from 'react';
import { useNavigate } from "react-router-dom";
import "./Main.css"; 

function Main() {
  const navigate = useNavigate(); 

  // Funkcia na logout
  const handleLogout = () => {
    // na odhlasenie vyčistí storage ktoru naplnilo v Login.js pri response
    localStorage.removeItem("isAuthenticated");

    // Redirect na login page
    navigate("/");
  };

  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <div className="sidebar">
        <p className="sidebar-address">Podivínska 12 Košice</p>
        <nav className="nav-links">
          <a href="#" className="nav-item">
            <div className="nav-icon">
              <img src="./Home.svg" alt="Home Icon" className="add-icon" />{" "}
            </div>
            <span>Home</span>
          </a>
          <a href="?" className="nav-item">
            <div className="nav-icon">
              <img
                src="./Calendar.svg"
                alt="Calendar Icon"
                className="add-icon"
              />{" "}
            </div>
            <span>Kalendár</span>
          </a>
        </nav>
      </div>

      <div className="main-content">
        <div className="header">
          <span>Erik Lakatoš</span>
          <span>3.p</span>
          <span>Byt č. 7</span>
          <button className="logout-button" onClick={handleLogout}>
            Log out
          </button>
        </div>

        <div className="dashboard-body">
          <div className="account-box">
            <div className="account-header">
              <h3>Stav uctu: 5824,58€</h3>
              <button className="add-btn">
                <img src="./Add.svg" alt="User Icon" className="add-icon" />{" "}
              </button>
            </div>
            <hr />
            <div className="account-graph">TU GRAF xdd</div>
          </div>

          {/* Tu vložíme TasksBox komponentu */}
          <TasksBox />
        </div>
      </div>
    </div>
  );
}

// Komponenta TasksBox
function TasksBox() {
  const [clenovia, setClenovia] = useState([]);

  // Načítanie údajov z backendu pri načítaní komponentu
  useEffect(() => {
    fetch('/api/clenovia')  // Predpokladáme, že endpoint je `/api/clenovia`
      .then((res) => res.json())
      .then((data) => setClenovia(data))
      .catch((err) => console.error('Error:', err));
  }, []);

  return (
    <div className="tasks-box">
      <h3>Práce tento mesiac</h3>
      <hr />
      <table>
        <thead>
          <tr>
            <th>Upratovanie</th>
            <th>Kosenie/Sneh</th>
          </tr>
        </thead>
        <tbody>
          {clenovia.map((clen, index) => (
            <tr key={clen.id}>
              <td>{`${index + 1}. týždeň - ${clen.meno} ${clen.priezvisko}`}</td>
              <td>{`${index + 1}. týždeň - ${clen.meno} ${clen.priezvisko}`}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

// Exportuj len Main komponentu
export default Main;
